import React, { Component } from 'react';

class Home extends Component {
    render(){

        const biggerLead = {
            fontSize: 2.4 + 'em', 
            fontWeight: 200
        };

        return(
            <div className="container text-center">
                <div className="row justify-content-center">
                    <div className="col-10 col-md-10 col-lg-8 col-xl-7">
                        <h4 className="display-4 text-primary mt-3 mb-2">Meeting Log</h4>
                        <p className="lead" style={biggerLead}>
                        This simple app creates meetings, allows people to check in, and
                        picks random users to award giveaways. It's a good example of a
                        Single Page Application which includes connection to a database and
                        routing. It's a practical way to learn
                        <a href="https://vuejs.org/">Vue.js</a>
                        with
                        <a href="https://firebase.google.com">Firebase</a>.
                        </p>
                       <a href="/register"
                            className="btn btn-outline-primary mr-2"
                       >Register</a>
                        <a href="/login"
                            className="btn btn-outline-primary mr-2"
                        >Log In</a>
                        <a href ="/meetings"
                            class="btn btn-primary"
                        >Meetings</a>
                   </div>
                </div>
            </div>
        );
    }
}

export default Home;
